import Head from "next/head";

export default function Meta(props) {
  return (
    <Head>
      <meta name="viewport" content="width=devide-width, initial_scale=1" />
      <meta charSet="utf-8" />
      <title>
        {props.pageTitle} - {process.env.siteTitle}
      </title>
      <meta name="Description" content={props.pageDescription} />
    </Head>
  );
}
